import "./IPhone14ProSpaceBlackMock.css";
const IPhone14ProSpaceBlackMock = () => {
  return (
    <div className="iphone-14-pro-space-black-mock">
      <img className="shadow-icon1" alt="" src="/shadow@2x.png" />
      <img className="main-icon1" alt="" src="/main@2x.png" />
      <img
        className="iphone-14-pro-space-black-mock1"
        alt=""
        src="/iphone-14-pro-space-black-mockup-label@2x.png"
      />
    </div>
  );
};

export default IPhone14ProSpaceBlackMock;
